import React from 'react';

const SpotSelect=()=> {
    
        return (
            <div>
                    <h1>Welcome to SpotPage</h1>
                <video autoPlay loop muted className="video-background">
                <source src="/videos/surfing.mp4" type="video/mp4" />
            </video>
            </div>
        );
    }

export default SpotSelect;
